import React from "react";
import ReactDOM from "react-dom";
import restaurantImage1 from "./Public/2023-08-12 (2).png";

const Logo = () => (
  <a href="#" onClick={() => window.location.reload()}>
    <img className="logo" src={restaurantImage1} alt="Description of the image" />
  </a>
);

const Title = () => <h1 className="title" >Tasty Traverse</h1>;

const HeaderComponent = () => {
  return (
    <div className="header">
    
      <Logo />
      <Title />
      <div className="nav-items">
      <ul className="horizontal-list">
        <li>Home</li>
        <li>About</li>
        <li>Contact</li>
      </ul>
    </div>
    </div>
  );
};

const RestaurantData = [
  {
    name: "BurgrKing",
    image:
    "https://www.livemint.com/lm-img/img/2023/07/12/1600x900/F0mVRPPacAICJm0_1689138352454_1689138366910.jpg",
  },
  {
    name: "McDonald's",
    image:
      "https://images.unsplash.com/photo-1624726175512-19b9baf9fbd1?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8Mnx8Zm9vZHN8ZW58MHx8MHx8fDA%3D&auto=format&fit=crop&w=600&q=60",
  },
  {
    name: "BBQ Haven",
    image:
      "https://images.unsplash.com/photo-1555939594-58d7cb561ad1?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8OXx8Zm9vZHN8ZW58MHx8MHx8fDA%3D&auto=format&fit=crop&w=600&q=60",
  },
  {
    name: "Pizza Hut",
    image:
      "https://images.unsplash.com/photo-1506354666786-959d6d497f1a?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MTF8fGZvb2RzfGVufDB8fDB8fHww&auto=format&fit=crop&w=600&q=60",
  },
  {
    name: "BurgerKing",
    image:
      "https://www.livemint.com/lm-img/img/2023/07/12/1600x900/F0mVRPPacAICJm0_1689138352454_1689138366910.jpg",
  },
  {
    name: "McDonald's",
    image:
      "https://images.unsplash.com/photo-1624726175512-19b9baf9fbd1?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8Mnx8Zm9vZHN8ZW58MHx8MHx8fDA%3D&auto=format&fit=crop&w=600&q=60",
  },
  {
    name: "BBQ Haven",
    image:
      "https://images.unsplash.com/photo-1555939594-58d7cb561ad1?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8OXx8Zm9vZHN8ZW58MHx8MHx8fDA%3D&auto=format&fit=crop&w=600&q=60",
  },
  {
    name: "Pizza Hut",
    image:
      "https://images.unsplash.com/photo-1506354666786-959d6d497f1a?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MTF8fGZvb2RzfGVufDB8fDB8fHww&auto=format&fit=crop&w=600&q=60",
  },
];

// const RestaurantCard = ({ name, image }) => (
//   <div className="restaurant-card">
//     <div className="restaurant-card-content">
//       <h2 className="restaurant-name">{name}</h2>
//       <p className="restaurant-rating">4.5 stars</p>
//     </div>
//     <img src={image} alt={name} />
//   </div>
// );
const RestaurantCard = ({name,image}) => (
  <div class="restaurant-card">
    <img className="restroImg" src={image} alt={name} />
    <p class="restaurant-name">{name}</p>
    <p class="restaurant-rating">Rating - 3.8</p>
    {/* <p class="item-info">21 MINS</p> */}
    {/* <p class="item-info">Non-veg item. Chicken Biryani.</p> */}
    <p class="bestseller">BESTSELLER</p>
    {/* <h2 class="item-name">Chicken Biryani</h2> */}
    {/* <p class="item-price">160 rupees</p> */}
    {/* <p class="item-desc">Richly flavored aromatic rice layered with marinated chicken pieces in a delicate blend of whole spices.</p>
    <p class="more-info">Swipe right to add item to cart.</p> */}
  </div>
)

const BodyComponent = () => {
  return (
    <div className="body">
      {RestaurantData.map((restaurant) => (
        <RestaurantCard key={restaurant.name} {...restaurant} />
      ))}
    </div>
  );
};

// const icons = () => {
//   return (
//     <div className="social-icons">
//   <a href="#"><img src="./facebook-icon.png" alt="Facebook" /></a>
//   <a href="#"><img src="./twitter-icon.png" alt="Twitter" /></a>
//   <a href="#"><img src="./instagram-icon.png" alt="Instagram" /></a>
// </div>
   
//   );
// };

const FooterComponent = () => {
  return (
    <div className="ftr">
      <p>&copy; 2023 Tasty Traverse. All rights reserved.</p>
            <p>123 Kochi, Kerala, India</p>
            <a href="/"><img src="./facebook-icon.png" alt="Facebook" /></a>
  <a href="/"><img src="./twitter-icon.png" alt="Twitter" /></a>
  <a href="/"><img src="./instagram-icon.png" alt="Instagram" /></a>
            
      
     
    </div>
  );
};

const AppLayout = () => {
  return (
    <>
      <HeaderComponent />
      <BodyComponent />
      <FooterComponent />
    </>
  );
};

const root = document.getElementById("root");
ReactDOM.render(<AppLayout />, root);
